DROP TABLE IF EXISTS matches;
CREATE TABLE matches(
   match_id     INTEGER NOT NULL AUTO_INCREMENT PRIMARY KEY
  ,blue_top     VARCHAR(20) NOT NULL
  ,blue_jungle  VARCHAR(20) NOT NULL
  ,blue_mid     VARCHAR(20) NOT NULL
  ,blue_adc     VARCHAR(20) NOT NULL
  ,blue_support VARCHAR(20) NOT NULL
  ,red_top      VARCHAR(20) NOT NULL
  ,red_jungle   VARCHAR(20) NOT NULL
  ,red_mid      VARCHAR(20) NOT NULL
  ,red_adc      VARCHAR(20) NOT NULL
  ,red_support  VARCHAR(20) NOT NULL
  ,result       VARCHAR(5) NOT NULL
  ,patch        VARCHAR(20) NOT NULL
  ,author       VARCHAR(200) NOT NULL
);
